import Tiza from './../components/Respaldo/Respaldo/Croquis/ColorDeFondo/FotosDeGeneros/Tiza.png';


export const colores= (nombre) =>{
    let color={
        'Tiza': Tiza,
        // 'Aluminio': Aluminio,
        // 'Stone': Stone,
        // 'Ceniza': Ceniza,
        // 'Grafito': Grafito,
        // 'Carbón': Carbón,
        // 'Negro': Negro,
        // 'Natural': Natural,
        // 'Niebla': Niebla,
        // 'Nougat': Nougat,
        // 'Madera': Madera,
        // 'Lila': Lila,
        // 'Pink': Pink,
        // 'Limón': Limón,
        // 'Agua': Agua,
        // 'Turquesa': Turquesa,
        // 'Blue': Blue,
        // 'Azul Lavado': AzulLavado,
        // 'Denim': Denim,
        // 'Marino': Marino,
        // 'Pimenton': Pimenton,
        // 'Lacre': Lacre,
        // 'Guinda': Guinda, 
        // 'Ginger': Ginger, 
        // 'Café': Café, 
        // 'Arena': Arena
    }
    return color[nombre];
}
